package com.k.blog.entity;import com.k.blog.enums.UserSexEnum;import java.io.Serializable;/** * @author kangkai on 2018/4/17. */public class User implements Serializable {    private static final long serialVersionUID = 1L;    private Long id;    private String userName;    private String passWord;    private UserSexEnum userSex;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getPassWord() {        return passWord;    }    public void setPassWord(String passWord) {        this.passWord = passWord;    }    public UserSexEnum getUserSex() {        return userSex;    }    public void setUserSex(UserSexEnum userSex) {        this.userSex = userSex;    }    @Override    public String toString() {        return "User{" +                "id=" + id +                ", userName='" + userName + '\'' +                ", passWord='" + passWord + '\'' +                ", userSex=" + userSex +                '}';    }}